DROP TRIGGER IF EXISTS `atendimentos`;
DELIMITER ;;
CREATE TRIGGER `atendimentos` AFTER INSERT ON `atendimentos` FOR EACH ROW BEGIN
  IF (NEW.OPCAOWEB = 'I') THEN
	id,
	NMATENDENTE,
	DATAHORA,
	DTATENDIMENTO,
	HRATENDIMENTO,
	TEMPOATENDIMENTO,
	OBSERVACAO,
	SEQOS,
	KMINICIAL,
	KMFINAL,
	CDMEDIDOR,
	MEDIDOR,
	MEDIDORDESC,
