	ATUALIZADO_WEB,
	SEQOSORIGEM,
	VALPEDAGIO,
	VALESTACIONAMENTO,
	VALOUTRASDESP,
	TEMPOVIAGEM,
	ATUALIZADO,
	CAUSA,
	SINTOMA,
	ACAO,
	VALATENDIMENTO,
	VALKM,
	HRVIAGEMINI,
	HRVIAGEMFIN,
	DTVIAGEMINI,
	DTVIAGEMFIN,
	OPCAOWEB
)
VALUES
	(
	NEW.id,
	NEW.NMATENDENTE,
	NEW.DATAHORA,
	NEW.DTATENDIMENTO,
	NEW.HRATENDIMENTO,
	NEW.TEMPOATENDIMENTO,
	NEW.OBSERVACAO,
	NEW.SEQOS,
	NEW.KMINICIAL,
	NEW.KMFINAL,
	NEW.CDMEDIDOR,
	NEW.MEDIDOR,
	NEW.MEDIDORDESC,
	NEW.DTMEDIDORDESC,
	NEW.PLACAVEICULO,
	NEW.HRATENDIMENTOFIN,
	NEW.TFVISITA,
	NEW.ATUALIZADO_WEB,
	NEW.SEQOSORIGEM,
	NEW.VALPEDAGIO,
	NEW.VALESTACIONAMENTO,
	NEW.VALOUTRASDESP,
	NEW.TEMPOVIAGEM,
	NEW.ATUALIZADO,
	NEW.CAUSA,
	NEW.SINTOMA,
	NEW.ACAO,
	NEW.VALATENDIMENTO,
	NEW.VALKM,
	NEW.HRVIAGEMINI,
	NEW.HRVIAGEMFIN,
	NEW.DTVIAGEMINI,
	NEW.DTVIAGEMFIN,
	NEW.OPCAOWEB
	);
	  END IF;
END
;;
