INSERT INTO `checklist_perguntas` VALUES ('2', 'O defeito encontrado é da máquina ou de outros itens de responsabilidade do cliente (infraestrutura, falha operacional, rede, instalação elétrica)? ');
INSERT INTO `checklist_perguntas` VALUES ('3', 'Há um software de Leitura (IBS ou XDA). Software esta  instalado e funcionando? ');
INSERT INTO `checklist_perguntas` VALUES ('4', 'Este atendimento é um atendimento avulso? em caso positivo. Liste as peças necessárias, e, em havendo possibilidade do atendimento requerer outros componentes deixe claro ao cliente essa possibilidade documente no RASE e descreva na baixa.');
